import { useEffect } from 'react';

import './App.css'

let entities = [1,2,3,4];

let set = []

for (let i = 0; i < entities.length; i++){
  for(let j = i + 1; j < entities.length; j++){
    set = [...set, [entities[i], entities[j]]]
  }
}

let compare = set[0]

let left = document.getElementById("left")
let right = document.getElementById("right")

function next(id: boolean) {
}
function load(){
  left.innerText = compare[0]
  right.innerText = compare[1]
}
function App() {
  useEffect(()=>{load()}, [])
  return (
    <>
      <div className='box left' onClick={()=>{next(false)}} id ="left"></div>
      <div className='box right' onClick={()=>{next(true)}} id = "right"></div>
    </>
  );
}

export default App;
